import React from 'react';
import {
    View,
    Text,
} from 'react-native';
function PickupScreen(props) {
    console.log(props);
    return (
        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>
            <Text>Scan Screen!</Text>
        </View>
    );
}
export default PickupScreen;
